// import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react'
import Navbar from './Components/Navbar';
import News from './Components/News';
import NewsItem from './Components/NewsItem';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <>
      <Router>
      <Navbar />
      {/* <News pageSize = {8}  country= "in" category= "science" /> */}
      {/* <NewsItem/> */}

{/* Here below an individual key is used so that every link can be differentiated with each other. */}
      <Switch>
          <Route exact path="/"> <News key="General" pageSize = {8}  country= "in" category= "General" /></Route>

          <Route exact path="/business"> <News key="business"  pageSize = {8} country= "in" category= "business" /></Route>

          <Route exact path="/entertainment"> <News pageSize = {8} key="entertainment" country= "in" category= "entertainment" /></Route>

          <Route exact path="/health"> <News pageSize = {8} key="health" country= "in" category= "health" /></Route>

          <Route exact path="/science"> <News pageSize = {8} key="Science" country= "in" category= "Science" /></Route>

          <Route exact path="/sports"> <News pageSize = {8} key="sports" country= "in" category= "sports" /></Route>

          <Route exact path="/technology"> <News pageSize = {8} key="technology" country= "in" category= "technology" /></Route>
        </Switch>

        </Router>
      </>
       )
  }
}
